import "./App.css";
import "./index.css";
import Moscu from "./Images/moscu.jpg";

function App() {
  return (
    <div className="App bg-black">
      <img className="w-7/12 ms-72" src={Moscu} alt="moscu" />
      <button className="btn btn-blue">BOOK YOUR TABLE</button>
    </div>
  );
}

export default App;
